import React from 'react';
import './CSS/footer.css'
import insta from '../img/logo';
import fb from '../img/logo_fb.png';
import twitter from '../img/logo_twitter.png';
import linkdin from '../img/logo_in.png';

export default class Footer extends React.Component{
    render(){
        return(
            <div className="footer">
                <p className="copyright">
                    Portfolio 2020 &copy; Copyrights reserved.
                </p>
                <ul>
                    <li><a href="https://www.instagram.com/aannaassalam/"><img src={insta} alt="Instagram"/></a></li>
                    <li><a href="https://www.facebook.com/anasalam027/"><img src={fb} alt="Facebook"/></a></li>
                    <li><a href="https://twitter.com/aannaassalam/"><img src={twitter} alt="Twitter"/></a></li>
                    <li><a href="https://www.linkedin.com/in/anas-alam-0207331b2/"><img src={linkdin} alt="LinkDin"/></a></li>
                </ul>
            </div>
        )
    }
}
